import React from "react";

function Awards() {
    return (
        <div className="award">
            <div className="first">
                <p>Enjoy on your TV</p>
                <p>Watch on smart TVs, PlayStation, Xbox, Chromecast, Apple TV, Blu-ray players and more.</p>
            </div>
            <div className="secImg">
            <img src="https://assets.spe.org/dims4/default/f502858/2147483647/strip/true/crop/724x483+0+0/resize/800x534!/quality/90/?url=http%3A%2F%2Fspe-brightspot.s3.us-east-2.amazonaws.com%2F79%2F6b%2Ffa51720542439da7a2202c0079f7%2Fgettyimages-2062707205.jpg" alt=""/>
            </div>
            <div className="first-second">
                <p>Enjoy on your TV</p>
                <p>Watch on smart TVs, PlayStation, Xbox, Chromecast, Apple TV, Blu-ray players and more.</p>
            </div>
            <div className="secImg">
            <img src="https://assets.spe.org/dims4/default/f502858/2147483647/strip/true/crop/724x483+0+0/resize/800x534!/quality/90/?url=http%3A%2F%2Fspe-brightspot.s3.us-east-2.amazonaws.com%2F79%2F6b%2Ffa51720542439da7a2202c0079f7%2Fgettyimages-2062707205.jpg" alt=""/>
            </div>
        </div>
    );
}
export default Awards;
